void neg_modus_ponens(std::ostream& os,
                      size_t& line_num,
                      std::string const& A,
                      std::string const& B)
{
    static size_t const len = strlen(neg_modus_proof);

    for (size_t i = 0; i < len; ++i)
    {
        char c = neg_modus_proof[i];

        if (c == '\n')
            line_num++;

        switch (c)
        {
        case 'A':
            os << A;
            break;
        case 'B':
            os << B;
            break;
        default:
            os << c;
            break;
        }
    }
}

