    "(((!A -> (!!A -> A)) -> ((!(!!A -> A) -> (!A -> !(!!A -> A))) -> ((!(!!A -> A) -> ((!A -> !(!!A -> A)) -> !!A)) -> (!(!!A -> A) -> !!A)))) -> ((!A -> (!!A -> A)) -> ((!(!!A -> A) -> ((!A -> !(!!A -> A)) -> !!A)) -> (!(!!A -> A) -> !!A))))\n"
    "((!A -> (!!A -> A)) -> ((!(!!A -> A) -> ((!A -> !(!!A -> A)) -> !!A)) -> (!(!!A -> A) -> !!A)))\n"
    "(((!A -> (!!A -> A)) -> (!(!!A -> A) -> ((!A -> !(!!A -> A)) -> !!A))) -> (((!A -> (!!A -> A)) -> ((!(!!A -> A) -> ((!A -> !(!!A -> A)) -> !!A)) -> (!(!!A -> A) -> !!A))) -> ((!A -> (!!A -> A)) -> (!(!!A -> A) -> !!A))))\n"
    "(((!A -> (!!A -> A)) -> ((!(!!A -> A) -> ((!A -> !(!!A -> A)) -> !!A)) -> (!(!!A -> A) -> !!A))) -> ((!A -> (!!A -> A)) -> (!(!!A -> A) -> !!A)))\n"
    "((!A -> (!!A -> A)) -> (!(!!A -> A) -> !!A))\n"
    "(!(!!A -> A) -> !!A)\n"
    "((!(!!A -> A) -> !A) -> ((!(!!A -> A) -> !!A) -> !!(!!A -> A)))\n"
    "((!(!!A -> A) -> !!A) -> !!(!!A -> A))\n"
    "!!(!!A -> A)\n";

void tenth_axiom(std::ostream& os,
                     size_t& line_num,
                     std::string const& A)
{
    static size_t const len = strlen(neg_tenth_ax_proof);

    for (size_t i = 0; i < len; ++i)
    {
        char c = neg_tenth_ax_proof[i];

        if (c == '\n')
            line_num++;

        switch (c)
        {
        case 'A':
            os << A;
            break;
        default:
            os << c;
            break;
        }
    }
}

